import { Navigation } from "react-minimal-side-navigation";
import { useHistory, useLocation } from "react-router-dom";
import React, { useState } from "react";
import { DiAptana } from "react-icons/di";
import { FaSearchPlus } from "react-icons/fa";
import { HiOutlineSwitchVertical } from "react-icons/hi";
import { AiOutlinePercentage, AiOutlineUnorderedList } from "react-icons/ai";
import { BiBasketball } from "react-icons/bi";

import "react-minimal-side-navigation/lib/ReactMinimalSideNavigation.css";

export const NavSidebar = () => {
  const history = useHistory();
  const location = useLocation();


  return (
    <React.Fragment>
      <div
        className={`fixed inset-y-0 left-0 z-30 w-24 overflow-y-auto transition ease-out transform translate-x-0 bg-black border-r-2 lg:translate-x-0 lg:static lg:inset-0 ${
          isSidebarOpen ? "ease-out translate-x-0" : "ease-in -translate-x-full"
        }`}
      >
        <Navigation
          activeItemId={location.pathname}
          onSelect={({ itemId }) => {
            history.push(itemId);
          }}
          items={[
            {
              title: "Hom",
              itemId: "/home",
            },
            {
              elemBefore: () => <FaSearchPlus />,
              itemId: "/zoom",
            },
            {
              elemBefore: () => <HiOutlineSwitchVertical />,
              itemId: "/projects",
            },
            {
              elemBefore: () => <AiOutlineUnorderedList />,
              itemId: "/bookmakers",
            },
            {
              elemBefore: () => <AiOutlinePercentage />,
              itemId: "/bookmakers",
            },
            {
              elemBefore: () => <BiBasketball />,
              itemId: "/sports",
            },
          ]}
        />

        <div className="absolute bottom-0 w-full my-8">
          <Navigation
            activeItemId={location.pathname}
            items={[
              {
                itemId: "/Setings",
                elemBefore: () => <DiAptana />,
              },
            ]}
            onSelect={({ itemId }) => {
              history.push(itemId);
            }}
          />
        </div>
      </div>
    </React.Fragment>
  );
};
